hold on %[output:882090fc]
plot(t, MRt_cmd(t1:t2), LineWidth=linwidth, LineStyle='--', Color='#004488') %[output:882090fc]
% plot(t, MRt_read, LineWidth=linwidth, LineStyle='--', Color='#004488' )
