% % Torques
% % Left motor
% plot(MLt_cmd)
% hold on
% plot(FP_tl)
% legend('command', 'Force plate reading');
% title('Left torques')
% hold off
% 
% % Right motor
% plot(MRt_cmd)
% hold on
% plot(FP_tr)
% legend('command', 'Force plate');
% title('Right torques')
% hold off
% 
% x = [FP_tl, FP_tr];
% y = [MLt_cmd; MRt_cmd]';
% percentError = mean(abs((y - x)./x)*100)
%%
x = [FP_tl, FP_tr];
y = [MLt_cmd; MRt_cmd]';
%Motor command compensation
plot(y, 'b'); %[output:568f8406]
hold on %[output:568f8406]
plot(x, 'r'); %[output:568f8406]
legend("cmd", "meas") %[output:568f8406]
hold off %[output:568f8406]
% Line of best fit

m1L_M2_comp = FP_tl(:)\MLt_cmd(:) %[output:10cdf18a]
RsqL = corrcoef(FP_tl, MLt_cmd).^2 %[output:53e43131]
percentErrorTorquesL = mean(abs((MLt_cmd' - FP_tl)./FP_tl)*100) %[output:3278eb14]
MSETorquesLM2 = mean((MLt_cmd' - FP_tl).^2) %[output:159d9aa8]
% [coeff, Sc] = polyfit(x,y, 1);
xFitL = linspace(min(FP_tl), max(MLt_cmd), 1000);
yFitL = polyval([m1L_M2_comp 0], xFitL);


scatter(FP_tl, MLt_cmd, 'b','filled') %[output:32ebaa93]
hold on %[output:32ebaa93]
plot(xFitL, yFitL, 'r-', LineWidth=2) %[output:32ebaa93]
title("Measured vs commanded torque for the Left motor (M2)"); %[output:32ebaa93]
ylabel("Motor commanded torque (Nm)"); %[output:32ebaa93]
xlabel("Force plate measured torque (Nm)"); %[output:32ebaa93]
legend("Measured data", "Line of best fit") %[output:32ebaa93]
hold off %[output:32ebaa93]

m1R_M3_comp = FP_tr(:)\MRt_cmd(:) %[output:65b20ac6]
RsqR = corrcoef(FP_tr, MRt_cmd).^2 %[output:37d3338e]
percentErrorTorquesR = mean(abs((MRt_cmd' - FP_tr)./FP_tr)*100) %[output:1fabd59d]
MSETorquesRM3 = mean((MRt_cmd' - FP_tr).^2) %[output:169ac353]
% [coeff, Sc] = polyfit(x,y, 1);
xFitR = linspace(min(FP_tr), max(MRt_cmd), 1000);
yFitR = polyval([m1R_M3_comp 0], xFitR);


scatter(FP_tr, MRt_cmd, 'b','filled') %[output:3ae2745a]
hold on %[output:3ae2745a]
plot(xFitR, yFitR, 'r-', LineWidth=2) %[output:3ae2745a]
title("Measured vs commanded torque for the Right motor (M3)"); %[output:3ae2745a]
ylabel("Motor commanded torque (Nm)"); %[output:3ae2745a]
xlabel("Force plate measured torque (Nm)"); %[output:3ae2745a]
legend("Measured data", "Line of best fit") %[output:3ae2745a]
hold off %[output:3ae2745a]
